import TopLine from "../components/TopLine";
import DlHeader from "../components/DlHeader";
import DlSection from "../components/DlSection ";
import DrHeader from "../components/DrHeader";
import DrSection from "../components/DrSection";
import { useState } from "react";

const Diary = () => {

    const [curDate, setCurDate] = useState(new Date());
    const headText = `${curDate.getFullYear()}.0${curDate.getMonth() + 1}`;


    const nextMonth = () => {
        console.log("다음 달");
    }

    const lastMonth = () => {
        console.log("지난 달");
    }

    return (
        <div className="Diary">
            <TopLine />
            <div className="dMain">
                <div className="dM-l">
                    <DlHeader leftChild={"<"} leftChildBtn={() => lastMonth()} 
                        headText={headText} rightChild={">"} rightChildBtn={nextMonth()}/>
                    <DlSection />
                </div>
                <div className="dM-r">
                    <DrHeader />
                    <DrSection />
                </div>
            </div>
        </div>

    );

}

export default Diary;
